In Traditional Chinese Medicine Spring is represented by the Wood Element which relates to the smooth flow of Qi energy as it expands and rises, and is like the shoot of a plant. The Wood Element embodies activity, growth and change, and in nature is apparent in the coming to life of Spring. It oversees the body‚Äôs cycles and rhythms; and it governs both our need to develop and ability to adapt. If we are moving in harmony with the seasons we should be doing the same.

The organs associated to the Wood element are the Liver and the Gall Bladder. The principal organ being the Liver, which is responsible for ensuring the smooth flow of Qi energy throughout the body/mind. The Liver also has an important influence on the blood, as it stores the blood in times of rest, releases it when we become active and maintains its smooth flow. If the Liver struggles in its action of releasing and the spreading the Qi, the flow of Qi energy will become restricted and result in a condition known as Qi-stagnation.

When Qi energy stagnates in the body, we often see issues that involve spasms; distension, pain, nervous tensions, constipation, headache and painful menstruation can arise. Stagnation of Qi is also related to feeling stuck and frustrated, as tense, moody and irritable conditions disrupt the function of the Liver and constrict the flow of Qi.

The highest expression of the Wood Element relates to how we view ourselves. Do we focus on our actions and created self or are we able to strip away our personality and actions to observe what is underneath. Judgement can imply a sense of right and wrong, so if we move beyond judgement and we can allow ourselves to just be, and allow others to just be. We can allow life to flow without constraint, and this comes from a place of true acceptance and true freedom, the freedom to just be ourselves. 

